import React from 'react';
import Navbar from "react-bootstrap/Navbar";
import { Link, NavLink } from 'react-router-dom';

export const NavBar = () => {
    return (
        <nav classNameName="navbar navbar-expand-sm navbar-dark bg-dark">
                <Link className="navbar-brand" to="/">useContext</Link>


                <div className="collapse navbar-collapse" id="navbarNavAltMarkup">
                <div className="navbar-nav">
                    <NavLink  activeClassName="" className="nav-link active" to="/">Home </NavLink>
                    <NavLink activeClassName="" className="nav-link" to="/about">About</NavLink>
                    <NavLink activeClassName="" className="nav-link" to="/login">Login</NavLink>

                </div>
                </div>
      </nav>
    )
}
